  return (
    <header className="header">
      <div className="header-content">
        {/* Logo section */}
        <Logo />

        {/* Optional: Add navigation links later */}
        <nav className="nav-links">
          {/* Navigation links can be added here */}
        </nav>
      </div>
    </header>
  );
};

export default Header;
